import Link from 'next/link';

const divStyle = {
  marginLeft: 400,
  marginRight: 400,
}

const linkStyle = {

  marginRight: 20,
  //verticalAlign: 'bottom' ,
};

const logoStyle = {
  //marginLeft: 0,
  //marginRight: 20,
  //verticalAlign: 'bottom' ,
  width: 100
};

const hrStyle = {
  borderTop: '2px solid #14a3bb',
};

const menuStyle = {
  marginTop: 40,
  float: 'right',
  //verticalAlign: 'middle',
}

const fontStyle = {
  color: '#14a3bb',
  fontSize: 20,
}
const Header = () => (
  <div style={divStyle}>

    <Link href="/">
      <a> <img style={logoStyle} src="../static/logo_1.png"/></a>
    </Link>
    <div style={menuStyle}>
      <Link href="/">
        <a style={linkStyle}><font style={fontStyle}>Home</font></a>
      </Link>
      <Link href="#about">
        <a style={linkStyle}><font style={fontStyle}>About</font></a>
      </Link>
      <Link href="#feature">
        <a style={linkStyle}><font style={fontStyle}>Features</font></a>
      </Link>
      <Link href="#partners">
        <a style={linkStyle}><font style={fontStyle}>Partners</font></a>
      </Link>
      <Link href="/amazon">
        <a style={linkStyle}><font style={fontStyle}>Amazon</font></a>
      </Link>
      <Link href="/naver">
        <a style={linkStyle}><font style={fontStyle}>Naver</font></a>
      </Link>
      <Link href="/shopee">
        <a style={linkStyle}><font style={fontStyle}>Shopee</font></a>
      </Link>
    </div>
    <hr style={hrStyle}></hr>
  </div>


);

export default Header;
